script: |
  super -f text -I q10439.spq | sort > q10439.out

inputs:
  - name: q10439.spq
    data: |
      SELECT col0 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE - 84 * - col0 NOT IN ( + col1, 74 * + col1 * - 46 );
  - name: tab2

outputs:
  - name: q10439.out
    data: |
      46
      64
      75
